// ======================================
// ============== DEEPCore ==============
// ======================================

/**
 * Constructor for the core DEEP system. Checks first that the
 * questionCount given is valid, and then sets up variables.
 * DEEPCore includes all of the core logic for DEEP, including
 * data storage, question generation, and the user flow.
 * The platform that calls DEEPCore asks for data and updates
 * their UI based on their own rules.
 * @param {String}  DEEPType      The DEEP type to load, either RISK or TIME.
 * @param {Integer} questionCount The number of questions to ask for DEEP.
 * @constructor
 */
var DEEPCore = function(DEEPType, questionCount) {
  // Check that the number of questions is valid, under 12
  if (questionCount > 12) {
    alert('This survey has encountered an error. Please contact the survey administrator with the following error message: "DEEP Time initialized with more than 12 questions; more than 12 questions is unsupported."');
  } else {
    // Store the variant of DEEP we are using
    if (DEEPType == "TIME" || DEEPType == "RISK") {
      this.DEEPType = DEEPType;
      this.questionCount = questionCount;

      // Set modes: debugMode
      if (typeof debugMode != 'undefined' && debugMode === true) {
        this.debugMode = true;
      }

      if (this.debugMode) {
        console.log('DEEP - Initializing DEEP ' + this.DEEPType + ' with ' + questionCount + ' questions');
      }
    } else {
      alert('This survey has encountered an error. Please contact the survey administrator with the following error message: "Invalid DEEP variant requested. DEEP ID must be DEEPTIME or DEEPRISK."');
    }
  }
}

// ================================================
// ============== DEEPCore Variables ==============
// ================================================

/**
 * Stores which type of DEEP to run, either TIME or RISK.
 * This stores a state that is used in many places in the class.
 * @type {String}
 */
DEEPCore.prototype.DEEPType = null;

/**
 * Stores the data as the user goes through DEEP.
 * Structure:
 * - Array (indexed by question number)
 *   - Object
 *     - choice: the selected choice, 0 or 1
 *     - answer: the selected choice, but represented as 1 or 2 instead
 *     - id
 *     - DEEP Time: beta, discount rate
 *     - DEEP Risk: alpha, sigma, lambda
 * @type {Array}
 */
DEEPCore.prototype.data = [];
DEEPCore.prototype.data[0] = {}; // There is no 'zeroth' question, so set it to empty

/**
 * Stores whether the instance of DEEP is initialized or not.
 * If not, renderChoices() will use fixed values for starting off.
 * @type {Boolean}
 */
DEEPCore.prototype.initialized = false;

/**
 * Represents the current step of DEEP the user is on, from 1..questionCount
 * @type {Number}
 */
DEEPCore.prototype.currentStep = 1;

/**
 * Represents the "path", a unique identifier for the specific path the user
 * took through DEEP. Each choice a user makes represents going on a different
 * path. Used in calculating the next question.
 * @type {Number}
 */
DEEPCore.prototype.path = 0;

/**
 * Stores the details of the current value of the first choice
 * that the user is given. DEEP Time: amount, time. DEEP Risk:
 * outcome0Chance, outcome0Amount, outcome1Chance, outcome1Amount.
 * @type {Object}
 */
DEEPCore.prototype.currentChoice0 = {};

/**
 * Stores the details of the current value of the second choice
 * that the user is given. DEEP Time: amount, time. DEEP Risk:
 * outcome0Chance, outcome0Amount, outcome1Chance, outcome1Amount.
 * @type {Object}
 */
DEEPCore.prototype.currentChoice1 = {};

