/**
 * Begin the initialization of DEEP. First sets the initial
 * values of the data for step 1, and then returns the choice
 * text by calling renderChoices(), which will recognize that
 * the system has not been initialized and will use hard-coded
 * initial values to set up the system and get the first choices.
 * @return {Array} Returns an array with the first two choices.
 */
DEEPCore.prototype.beginDEEP = function() {
  // Initialize data with initial ID, beta, and discount rate
  this.data[this.currentStep] = {}
  this.data[this.currentStep]['id'] = 0;

  if (this.isDEEPTime()) {
    this.data[this.currentStep].beta = 0.8;
    this.data[this.currentStep].discountRate = 0.008;
  }

  if (this.isDEEPRisk()) {
    this.data[this.currentStep].alpha = 0.6
    this.data[this.currentStep].sigma = 0.8
    this.data[this.currentStep].lambda = 2.2
  }

  // Return the array of the first choices
  return this.renderChoices();
}

/**
 * Save the choice that the user selected.
 * Function called by DEEPQualtrics/DEEPLimeSurvey.saveChoice().
 * Calculates the itemRiskIndex, gets the risk values, new ID,
 * new path, and saves all of that to the data.
 * @param  {Integer} choice The choice made by the user.
 */
DEEPCore.prototype.saveChoice = function(choice) {
  // Calculate the index for looking up the beta/discountRate in itemRiskIndex
  var itemRiskIndex = (this.path * 2 + choice);

  if (this.isDEEPTime()) {
    // DEEPTime uses an itemRiskIndex multiplied by 2
    // for their array lookup
    itemRiskIndex = itemRiskIndex * 2;
  }

  // Get the beta and discount rate
  var risks = this.getRisks(this.currentStep, itemRiskIndex);

  // Store the current choice, which is [0,1]
  this.data[this.currentStep].choice = choice;

  // Store the current "answer", which is [1,2]
  this.data[this.currentStep].answer = choice + 1;

  // Get the new ID
  // Returns the number for the ID up to this point
  var newID = this.getID(this.currentStep);

  // Calculate the new path
  this.path = this.getCurrentPath();

  // Store the ID/beta/discount rate in the question ahead
  this.data[this.currentStep + 1] = {};
  this.data[this.currentStep + 1]['id'] = newID;

  if (this.isDEEPTime()) {
    this.data[this.currentStep + 1]['beta'] = risks.beta;
    this.data[this.currentStep + 1]['discountRate'] = risks.discountRate;
  }

  if (this.isDEEPRisk()) {
    this.data[this.currentStep + 1]['alpha']  = risks.alpha;
    this.data[this.currentStep + 1]['sigma']  = risks.sigma;
    this.data[this.currentStep + 1]['lambda'] = risks.lambda;
  }

  if (this.debugMode) {
    console.log('Saved data for step ' + this.currentStep);
    console.log(this.data);
  }
}

/**
 * Calculates the current path. The path is the identifier for
 * the specific path that the user has taken through the DEEP
 * process.
 * @return {Integer} The number of the current path.
 */
DEEPCore.prototype.getCurrentPath = function() {
  var path = 0;

  // For each step:
  for (var i = 1; i <= this.currentStep; i++) {
    if (this.data[i]) {
      // Get corresponding choice
      var choice = this.data[i].choice;

      // Multiply the path by 2
      path = path * 2;

      // Add the value of the choice
      path = path + choice;
    }
  }

  return path;
}

/**
 * Get the next question. Checks whether the question maximum has
 * been reached; if so, invokes finish; if not, increases the
 * current step and returns the choice text from renderChoices().
 * @return {Array} Returns an array of the choices for the next
 *                 question, or false if the maximum number of
 *                 questions has been reached.
 */
DEEPCore.prototype.nextQuestion = function() {
  // First check if the current step is the last step
  if (this.currentStep >= this.questionCount) {
    // Question limit reached
    return false;
  } else {
    // Increment current step
    this.currentStep++;

    // Render the choices and return the array of choices
    return this.renderChoices();
  }
}

/**
 * Render the set of choices for the current step.
 * <p>
 * Our goal here is to get a set of two options to give
 * to the user. Options are stored in two arrays:
 * codedChoices0 and codedChoices1. Therefore, we need
 * to pull one element out of the codedChoices0 array,
 * and one element out of the codedChoices1 array.
 * <p>
 * How do we know what element to pull out? First, we
 * use codedIndexers, which is an array that contains
 * all of the steps and a corresponding string that
 * contains the corresponding index. We look up the
 * current path (this.path) which represents what path
 * we are on in the DEEP process. We get an alphabetical
 * letter, and we convert that letter using its keyCode
 * to an integer, and *that* is the index we are looking
 * up on to find which codedChoices0 or codedChoices1
 * element to use.
 * <p>
 * codedIndexers works in an interesting way. Given
 * that we are on step 2, and the string is "BBcA".
 * If we are on path 1, the letters that correspond
 * to the index that we want for path 1 are at the
 * position "path * 2" and "path * 2 + 1". That is,
 * positions 3 and 4, or "cA". The "c" corresponds
 * to the index for codedIndexers0, and the "A"
 * corresponds to the index for codedIndexers1.
 * getChoiceIndex() pulls out the correct one.
 * <p>
 * After we get the letter, we convert it from an
 * alphabetical letter to an integer that represents
 * the index to look up on. This is done in
 * decodeIndexer().
 * <p>
 * Finally, index in hand, we can then look up that
 * index in the codedChoices0 and codedChoices1 to
 * find the corresponding choice to show. Whew!
 * <p>
 * Once we save the choice text, then we return the
 * array of the choice text.
 * @return {Array} A two-item array of the text of the choices.
 * @see {@link DEEPCore#getChoiceOption}
 * @see {@link DEEPCore#getChoiceIndex}
 */
DEEPCore.prototype.renderChoices = function() {
  if (this.currentStep == 1 && this.initialized == false) {
    // First run: set choices to an initial state
    if (this.isDEEPTime()) {
      this.currentChoice0 = {amount: 95, time: 0};
      this.currentChoice1 = {amount: 250, time: 90};
    }

    if (this.isDEEPRisk()) {
      this.currentChoice0 = {outcome0Chance: .9, outcome0Amount: 1, outcome1Chance: .1, outcome1Amount: 5};
      this.currentChoice1 = {outcome0Chance: .3, outcome0Amount: 100, outcome1Chance: .7, outcome1Amount: -20};
    }
  } else {
    // A regular step, not first run
    // Get the next choices
    this.currentChoice0 = this.getChoiceOption(0);
    this.currentChoice1 = this.getChoiceOption(1);
  }

  // Get the choice text
  var choiceText = [];
  choiceText[0]  = this.getChoiceText(this.currentChoice0);
  choiceText[1]  = this.getChoiceText(this.currentChoice1);

  // Return the choice text
  return choiceText;
}

/**
 * Gets the choice index, which is used as the index for the
 * arrays containing the potential choices of options. Takes in
 * a step and a choice number (whether we are usng codedChoices0
 * or codedChoices1), gets the indexer, decodes it, and returns
 * the integer of the array index.
 * @param  {Integer} step      The step number to look up on.
 * @param  {Integer} path      The number ID for the current path.
 * @param  {Integer} choiceNum Whether we are looking for an index
 *                             for codedChoices0 or codedChoices1.
 * @return {Integer}           The array index for looking up on
 *                             codedChoices0 or codedChoices1.
 * @see    {@link DEEPCore#renderChoices}
 */
DEEPCore.prototype.getChoiceIndex = function(step, path, choiceNum) {
  var choiceCodedIndexer;

  // First, get the ASCII indexer, for which the charcode
  // represents the actual number
  
  if (this.isDEEPTime()) {
    choiceCodedIndexer = this.priors.time.codedIndexers[step].charCodeAt(path * 2 + choiceNum);
  }

  if (this.isDEEPRisk()) {
    choiceCodedIndexer = this.priors.risk.codedIndexers[step].charCodeAt(path * 2 + choiceNum);
  }

  // Next, decode the indexer and return it
  return this.decodeIndexer(choiceCodedIndexer);
}

/**
 * Get a choice option given a set and the index of the choice.
 * It finds the requested option set (codedChoices0 or codedChoices1),
 * and looks up the choice at the given choiceIndex. Afterwards, it
 * returns an object containing the vaues of that choice, depending
 * on whether it is for DEEP Time or DEEP Risk.
 * @param  {Integer} optionSet   The option set to use, either 0 or 1,
 *                               corresponding to codedChoices0 or codedChoices1. 
 * @param  {Integer} choiceIndex The index of the choice in the array for the
 *                               requested choice set.
 * @return {Object}              An object containing the values for the choice.
 *                               In DEEP Time: amount, time. In DEEP Risk:
 *                               outcome0Chance, outcome0Amount, outcome1Chance,
 *                               outcome1Amount.
 * @see    {@link DEEPCore#renderChoices}
 */
DEEPCore.prototype.getChoiceOption = function(optionSet) {
  // Get the choice index
  var choiceIndex = this.getChoiceIndex(this.currentStep, this.path, optionSet);

  var choiceOption = {};

  if (this.isDEEPTime()) {
    // Extract the two values
    choiceOption.amount = this.priors.time['codedChoices' + optionSet][choiceIndex][0];
    choiceOption.time   = this.priors.time['codedChoices' + optionSet][choiceIndex][1];
  }

  if (this.isDEEPRisk()) {
    // Extract the four values
    choiceOption.outcome0Chance = this.priors.risk['codedChoices' + optionSet][choiceIndex][1];
    choiceOption.outcome0Amount = this.priors.risk['codedChoices' + optionSet][choiceIndex][0];
    choiceOption.outcome1Chance = this.priors.risk['codedChoices' + optionSet][choiceIndex][3];
    choiceOption.outcome1Amount = this.priors.risk['codedChoices' + optionSet][choiceIndex][2];
  }

  return choiceOption;
}

/**
 * Decodes an alphanumeric indexer. Different decode behavior between
 * DEEP Time and DEEP Risk.
 * <p>
 * Ported from Legacy Qualtrics DEEP.
 * @param  {String}  letter The string to convert.
 * @return {Integer}        The decoded number.
 */
DEEPCore.prototype.decodeIndexer = function (letter) {
  if (this.isDEEPTime()) {
    if (letter >= 97) {
      return letter - 97 + 26;
    } else {
      return letter - 65;
    } 
  }

  if (this.isDEEPRisk()) {
    if (letter >= 97 ) 
      return letter -97 + 26 ;
    if (letter >= 65 ) 
      return letter - 65;
    if (letter >= 48 ) 
      return letter -48 + 52;
    if (letter >= 42 ) 
      return letter -42 + 62;       
    return 0;
  }
}

/**
 * Decode a set of variables into a number representing risk, either
 * for alpha, sigma, or lambda.
 * <p>
 * Ported from Legacy Qualtrics DEEP.
 * I don't really know how this works, either.
 * @param  {String}  s0       
 * @param  {String}  s1       
 * @param  {String}  s2       
 * @param  {String}  s3       
 * @param  {Integer} sign     
 * @param  {Integer} e        
 * @param  {Boolean} isLambda 
 * @return {Number}           The decoded number.
 */
DEEPCore.prototype.decodeRiskNumber = function MydeCodeNumber(s0, s1, s2, s3, sign, e, isLambda) {
  var n = ((this.decodeIndexer(s3) * 67 + this.decodeIndexer(s2)) * 67 + this.decodeIndexer(s1)) * 67 + this.decodeIndexer(s0);
  var n2 = Math.floor(n / 2);
  var e2 = n % 2;
  var real_e = isLambda ? (e2 * 4 + e - 5) : (e2 * 2 + e - 1);
  var result = sign * n2 * 0.000001 * Math.pow(10, real_e);
  var stringResult = result.toFixed(11).replace(/0+$/, '');
  return Number(stringResult);
}

/**
 * Get the risks for a given step and itemRiskIndex. Finds the
 * risk index array for that step, and then finds the risks.
 * Risks for DEEP Time: beta, discount rate. Risks for DEEP Risk:
 * alpha, sigma, lambda.
 * <p>
 * Ported from Legacy Qualtrics DEEP.
 * @param  {Integer} step          The step to look up.
 * @param  {Integer} itemRiskIndex The index of the itemRisks array to look up.
 * @return {Object}                For DEEP Time: beta, discountRate.
 *                                 For DEEP Risk: alpha, sigma, lambda.
 */
DEEPCore.prototype.getRisks = function(step, itemRiskIndex) {
  var risks = {};

  if (this.isDEEPTime()) {
    // Get the risks from the itemRisks array
    risks.beta = this.priors.time.itemRisks[step][itemRiskIndex]  / 100000.0;
    risks.discountRate = this.priors.time.itemRisks[step][itemRiskIndex + 1] / 100000.0;
  }

  if (this.isDEEPRisk()) {
    if (step == 1) {
      // Step 1 has a different behavior than the others
      var risksSet = this.priors.risk.itemRisks[step][itemRiskIndex].split(",");
      risks.alpha  = Number(risksSet[0]);
      risks.sigma  = Number(risksSet[1]);
      risks.lambda = Number(risksSet[2]);
    } else {
      // Fetch the risks with lots of math
      if ((itemRiskIndex + 1) * 13 <= this.priors.risk.itemRisks[step].length) {
        var itemRisks = this.priors.risk.itemRisks[step];
        var n1 = this.decodeIndexer(itemRisks.charCodeAt(itemRiskIndex * 13 + 12));
        var e3 = Math.floor(n1 / 8)
        var sign = (Math.floor(((n1 % 8) / 4)) == 1) ? 1 : -1;
        var e1 = Math.floor((n1 % 4) / 2);
        var e2 = n1 % 2;

        risks.alpha  = this.decodeRiskNumber(itemRisks.charCodeAt(itemRiskIndex * 13), itemRisks.charCodeAt(itemRiskIndex * 13 + 1), itemRisks.charCodeAt(itemRiskIndex * 13 + 2), itemRisks.charCodeAt(itemRiskIndex * 13 + 3), 1, e1, false);
        risks.sigma  = this.decodeRiskNumber(itemRisks.charCodeAt(itemRiskIndex * 13 + 4), itemRisks.charCodeAt(itemRiskIndex * 13 + 5), itemRisks.charCodeAt(itemRiskIndex * 13 + 6), itemRisks.charCodeAt(itemRiskIndex * 13 + 7), 1, e2, false);
        risks.lambda = this.decodeRiskNumber(itemRisks.charCodeAt(itemRiskIndex * 13 + 8), itemRisks.charCodeAt(itemRiskIndex * 13 + 9), itemRisks.charCodeAt(itemRiskIndex * 13 + 10), itemRisks.charCodeAt(itemRiskIndex * 13 + 11), sign, e3, true);
      }
    }
  }

  return risks;
}

/**
 * Calculates the ID for the given step. The ID represents the
 * unique position of the user according to the choices they
 * made throughout the DEEP process. Iterates through every step
 * and calculates the ID given their choices. If their choice
 * for a given step was 0, add 1; if their choice was 1, add the
 * unique value corresponding to that step (lookup in stepIDValue).
 * This way, you get a number that represents their unique position
 * in the DEEP process.
 * <p>
 * Ported from Legacy Qualtrics DEEP.
 * @param  {Integer} step The requested step to calculate the ID for.
 * @return {Integer}      The ID corresponding to the given step.
 */
DEEPCore.prototype.getID = function(step) {
  var totalID = 0;
  // For each step:
  for (var i = 1; i <= step; i++) {
    if (this.data[i]) {
      // Get corresponding choice
      var choice = this.data[i].choice;

      if (choice === 0) {
        // If the choice is 0, add 1
        totalID = totalID + 1;
      } else if (choice === 1) {
        // If the choice is 1, add stepIDValue
        // Uses a different stepIDValue depending on DEEPType
        totalID = totalID + this.priors[this.DEEPType.toLowerCase()].stepIDValue[i];
      }
    }
  }

  return totalID;
}

/**
 * Return the HTML text for the choice given the required parameters, which is
 * meant to be put in the button that allows them to select a choice.
 * @param  {Object} choiceSet The set containing the attributes for the choice.
 *                            For DEEP Time: amount, time.
 *                            For DEEP Risk: outcome0Chance, outcome0Amount,
 *                            outcome1Chance, outcome1Amount.
 * @return {String}           HTML string containing the markup for that choice.
 */
DEEPCore.prototype.getChoiceText = function(choiceSet) {
  if (this.isDEEPTime()) {
    var amount = choiceSet.amount;
    var time = choiceSet.time;

    return "Receive <strong>$" + amount + (time == 0 ? " today" : (time == 7 ? " in 1 week" : (time == 14 ? " in 2 weeks" : (time == 30 ? " in 1 month" : (time == 60 ? " in 2 months" : (time == 90 ? " in 3 months" : (" in " + time + " days"))))))) + "</strong>";
  }

  if (this.isDEEPRisk()) {
    var outcome0Chance = choiceSet.outcome0Chance;
    var outcome0Amount = choiceSet.outcome0Amount;
    var outcome1Chance = choiceSet.outcome1Chance;
    var outcome1Amount = choiceSet.outcome1Amount;

    return "<strong>" + outcome0Chance * 100 + "%</strong> Chance to <strong>"+ (outcome0Amount > 0 ? "Win" : "Lose") + " $" + (outcome0Amount < 0 ? -outcome0Amount : outcome0Amount) +"</strong><br><strong>" + outcome1Chance * 100 + "%</strong> Chance to <strong>" + (outcome1Amount > 0 ? "Win" : "Lose") + " $" + (outcome1Amount < 0 ? -outcome1Amount : outcome1Amount) +"</strong>";
  }
}

/**
 * Converts the data into JSON and returns it.
 * @return {String} The JSON string for the data.
 */
DEEPCore.prototype.getJSON = function() {
  return JSON.stringify(this.data);
}

/**
 * Helper method that returns whether the current DEEP
 * variant is DEEP Time or not.
 * @return {Boolean} true if the current DEEP variant is DEEP Time; false if not.
 */
DEEPCore.prototype.isDEEPTime = function() {
  return this.DEEPType == "TIME";
}

/**
 * Helper method that returns whether the current DEEP
 * variant is DEEP Risk or not.
 * @return {Boolean} true if the current DEEP variant is DEEP Risk; false if not.
 */
DEEPCore.prototype.isDEEPRisk = function() {
  return this.DEEPType == "RISK";
}
